import React from 'react'
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import '../../index.css'

const HeaderCartButton = (props) => {
  return (
    <button className='hover:bg-[#2c0d00] border-none rounded-xl py-1 px-4 bg-[#4d1601] flex justify-around text-white font-bold w-32'>
      <span className='w-4 h-4'>
        <ShoppingCartIcon/>
        </span>
      <span>Your Cart</span>
      <span>3</span>
    </button>
  )
}

export default HeaderCartButton
